import CardPromo from "./CardPromo/CardPromo";

export default function ({ cards, setStep }) {

  const startRoute = () => {
    setStep(card.id - 1);
  }

  return (
    <div>
      {
        cards.map(card => (
          <CardPromo key={card.id} card={card} startRoute={startRoute} />
        ))
      }
    </div>
  );
}
